import './App.css';
import Navbar from './Components/Navbar/Navbar';
import { BrowserRouter, Route,Routes } from 'react-router-dom';
import ShopCategories from './Pages/ShopCategories';
import LoginSignup from './Pages/LoginSignup';
import Shop from './Pages/Shop';
import Products from './Pages/Products';
import Cart from './Pages/Cart';
import Footer from './Components/Footer/Footer';
function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path='/' exact element={<Shop/>} />
        <Route path='/Fatilizer' exact element={<ShopCategories category="Fatilizer"/>} />
        <Route path='/Vegetables' exact element={<ShopCategories category="Vegetables"/>} />
        <Route path='/Fruits' exact element={<ShopCategories category="Fruits"/>} />
        <Route path='/Products' exact element={<Products/>}>
          <Route path=':productId' exact element={<Products/>} />
        </Route>
        <Route path='/Cart' exact element={<Cart/>} />
        <Route path='/login' exact element={<LoginSignup/>} />
      </Routes>
      <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
